webpackJsonp([0x7480112e0370],{555:function(e,o){e.exports={data:{site:{siteMetadata:{title:"Voracious Bookworm",author:"Lei"}},markdownRemark:{id:"/home/lei-lo/Code/voraciouscoder.github.io/src/pages/reading-roundup-27/index.md absPath of file >>> MarkdownRemark",html:"<p>I’m slowly making my through the <em>Circe</em> audiobook, so I had to pair it with some non-fiction (or poetry - but poetry collections are also slow-going).</p>\n<p><strong>Bad Feminist</strong><br>\n<em>Popsugar Reading Challenge: A book about feminism</em></p>\n<p>I have so many FEELS about this book. The best part of it for me was the fresh perspective. Roxane Gay is an unapologetic voice for so many unrepresented people. </p>\n<p>The collection is personal and unabashed. It made me feel the humanities gap in my STEM education, in my writing and analysis. Good thing learning doesn’t stop in school ;)</p>",frontmatter:{title:"Reading Roundup 27",date:"September 09, 2018"}}},pathContext:{slug:"/reading-roundup-27/",previous:{fields:{slug:"/reading-roundup-26/"},frontmatter:{title:"Reading Roundup 26"}},next:null}}}});
